description:
Anti-Corruption Force (ACF) that eliminates the most corrupt individuals, from all 

walks of life, in a systematic manner. As pressure builds on Police and Government 

to track down the man who masterminds these killings, Balbir Singh (Sonu Sood) is 

specially summoned to head the task. He is aided by Suryam (Prakash Raj) who, though 

being just a constable in the mammoth Police force, is compelled by his instincts to 

see through the underlying design. 

